import React, {useEffect, useState} from "react";
import {Link} from "react-router-dom";
import '../css/index.css';


const Home = () => {
    const[lctrRprsAdmin, setLctrRprsAdmin] = useState([]);
    const[lctrRprsGeneral, setLctrRprsGeneral] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState("");
    const[ntcs,setNtc] = useState([]);
    let i = 1;

    useEffect(() => {
        // fetch("http://localhost:9193/api/lctrStatsSrch/listAdmin")
        // .then((response) => {
        //     if (!response.ok) {
        //     throw new Error("강좌 목록을 불러오는 데 실패했습니다.");
        //     }
        //     return response.json();
        // })
        // .then((data) => {
        //     setLctrRprsAdmin(data);
        //     setLoading(false);
        // })
        // .catch((error) => {
        //     setError(error.message);
        //     setLoading(false);
        // });

        // fetch("http://localhost:9193/api/lctrStatsSrch/listGeneral")
        // .then((response) => {
        //     if (!response.ok) {
        //     throw new Error("강좌 목록을 불러오는 데 실패했습니다.");
        //     }
        //     return response.json();
        // })
        // .then((data) => {
        //     setLctrRprsGeneral(data);
        //     setLoading(false);
        // })
        // .catch((error) => {
        //     setError(error.message);
        //     setLoading(false);
        // });


        // fetch('http://localhost:9191/api/ntc/main')
        // .then((res) => res.json())
        // .then((res) => {
        //     setNtc(res);
        // });
    }, []);

    return(
        <div style={{ width: '100%' }}>
            
            <div class="container2" >
                <div class="title-container2" >
                    <div class="title-main2">AI 영상분석</div>
                    <div class="subtitle-main">Subtitle</div>
                </div>
            </div>
            <div class="container3">
                <div class="title-container">
                    <div class="title">강좌리스트(개인)</div>
                </div>
                <table class="board">
                    <thead>
                        <tr>
                            <th>강좌제목</th>
                            <th>강사이름</th>
                            <th>강좌종류</th>
                            <th>등록일</th>
                        </tr>
                    </thead>
                    <tbody>
                       {lctrRprsAdmin.length > 0 ? (
                            lctrRprsAdmin.slice(0,3).map((lctr, index) => (
                            <tr key={`${lctr.lctrSeq}-${index}`}>
                                {/* <td>{lctr.lctrSeq}</td> */}
                                <td>
                                {/* 강좌 제목을 클릭하면 상세보기 페이지로 이동 */}
                                <Link to={`/lctrStatsSrch/lctrDtlStats/${lctr.lctrSeq}`}>
                                    {lctr.lctrTtl}
                                </Link>
                                </td>
                                <td>{lctr.instrNm}</td>
                                <td>{lctr.lctrKnd}</td>
                                <td>{lctr.regYmd}</td>
                            </tr>
                            ))
                        ) : (
                            <tr>
                            <td colSpan="6" className="no-data">강좌가 없습니다.</td>
                            </tr>
                        )}
                    </tbody>
                </table>
            </div>
            <div class="container3">
                <div class="title-container">
                    <div class="title">강좌리스트(기관)</div>
                </div>
                <table class="board">
                    <thead>
                        <tr>
                            <th>강좌제목</th>
                            <th>강사이름</th>
                            <th>강좌종류</th>
                            <th>등록일</th>
                        </tr>
                    </thead>
                    <tbody>
                       {lctrRprsGeneral.length > 0 ? (
                            lctrRprsGeneral.slice(0,3).map((lctr, index) => (
                            <tr key={`${lctr.lctrSeq}-${index}`}>
                                {/* <td>{lctr.lctrSeq}</td> */}
                                <td>
                                {/* 강좌 제목을 클릭하면 상세보기 페이지로 이동 */}
                                <Link to={`/lctrStatsSrch/lctrDtlStats/${lctr.lctrSeq}`}>
                                    {lctr.lctrTtl}
                                </Link>
                                </td>
                                <td>{lctr.instrNm}</td>
                                <td>{lctr.lctrKnd}</td>
                                <td>{lctr.regYmd}</td>
                            </tr>
                            ))
                        ) : (
                            <tr>
                            <td colSpan="6" className="no-data">강좌가 없습니다.</td>
                            </tr>
                        )}
                    </tbody>
                </table>
            </div>
            
            <div class="container3">
                
                    <div class="title-container">
                        <div class="title">공지사항</div>
                    </div>
                    <table class="board">
                        <thead>
                            <tr>
                                <th>번호</th>
                                <th>제목</th>
                                <th>등록일</th>
                                <th>작성자</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                ntcs.map((item) => (
                                <tr key={item.no}>
                                    <td>
                                        {
                                            item.ntcYn == 'Y' ? '공지' : i++
                                        }
                                    </td>
                                    <td><Link to={`/ntc/NtcDtl?no=${item.no}`}>{item.title}</Link></td>
                                    <td>{item.regDt}</td>
                                    <td>{item.mbrVo.user}</td>
                                </tr>
                                ))}
                        </tbody>
                    </table>
            </div>
            
        </div>
            
            
            
            
        
    );
};

export default Home;
